description:
&quot;In Champagne Showers, small town girl played by Jessa Rhodes moves to Los Angeles to pursue her dreams of becoming a singer. Fame doesn't come easy for her, as she faces rejection and sex at every direction. Struggling, Jessa manages to land a job at a bar occupied with hot and flirty female bartenders Nikita Von James, Kirsten Price, Layla Sin and Breanne Benson. There she gains the confidence needed to perform at the talent showcase and with the support of all her bartenders. Throughout this emotional drama you will be treated to an array of sexual experiences and lusty affairs. It's hot, it's steamy and it's a visual triumph for your libido.&quot;

Jessa Rhodes, Nikita Von James, Kirsten Price, Breanne Benson, Layla Sin, Alektra Blue.


